import { Link } from "react-router-dom";

function UserLayout() {
    return (
        <span>
             <li>
            <Link to="/login">Login</Link>
          </li>
          <li>
            <Link to="/register">Register</Link>
          </li>
        </span>
    )
}

export default UserLayout;
